CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE IF NOT EXISTS "users" ("id" SERIAL PRIMARY KEY NOT NULL, "username" varchar, "password_digest" varchar, "role" varchar, "active" boolean DEFAULT 't');
CREATE TABLE IF NOT EXISTS "customers" ("id" SERIAL PRIMARY KEY NOT NULL, "first_name" varchar, "last_name" varchar, "email" varchar, "phone" varchar, "user_id" integer, "active" boolean DEFAULT 't', "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL, CONSTRAINT "fk_rails_9917eeaf5d"
FOREIGN KEY ("user_id")
  REFERENCES "users" ("id")
);
CREATE TABLE IF NOT EXISTS "addresses" ("id" SERIAL PRIMARY KEY NOT NULL, "customer_id" integer, "is_billing" boolean, "recipient" varchar, "street_1" varchar, "street_2" varchar, "city" varchar, "state" varchar, "zip" varchar, "active" boolean DEFAULT 't', CONSTRAINT "fk_rails_d5f9efddd3"
FOREIGN KEY ("customer_id")
  REFERENCES "customers" ("id")
);
CREATE TABLE IF NOT EXISTS "items" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "description" text, "category" varchar, "units_per_item" integer, "weight" float, "active" boolean DEFAULT 't', "picture" varchar);
CREATE TABLE IF NOT EXISTS "item_prices" ("id" SERIAL PRIMARY KEY NOT NULL, "item_id" integer, "price" float, "start_date" date, "end_date" date, CONSTRAINT "fk_rails_30c7a965d1"
FOREIGN KEY ("item_id")
  REFERENCES "items" ("id")
);
CREATE TABLE IF NOT EXISTS "orders" ("id" SERIAL PRIMARY KEY NOT NULL, "customer_id" integer, "address_id" integer, "date" date, "grand_total" float, "payment_receipt" varchar, CONSTRAINT "fk_rails_3dad120da9"
FOREIGN KEY ("customer_id")
  REFERENCES "customers" ("id")
, CONSTRAINT "fk_rails_774ef80392"
FOREIGN KEY ("address_id")
  REFERENCES "addresses" ("id")
);
CREATE TABLE IF NOT EXISTS "order_items" ("id" SERIAL PRIMARY KEY NOT NULL, "order_id" integer, "item_id" integer, "quantity" integer, "shipped_on" date, CONSTRAINT "fk_rails_e3cb28f071"
FOREIGN KEY ("order_id")
  REFERENCES "orders" ("id")
, CONSTRAINT "fk_rails_3e402078fd"
FOREIGN KEY ("item_id")
  REFERENCES "items" ("id")
);
