INSERT INTO items VALUES(1,'Honey Wheat Bread','Our original bread made with stone ground flour, clover honey and a lot of love. This versatile bread is great for toast, sandwiches, formal dinners and just when you need to munch.','bread',1,1.0,'t',NULL);
INSERT INTO items VALUES(2,'Cinnamon Swirl Bread','Your family will be impressed with the soft texture and appealing swirls of cinnamon in these lovely breakfast loaves.','bread',1,1.0,'t',NULL);
INSERT INTO items VALUES(3,'Apple Cherry Bread','A delicious bread made with white flour, dried cherries and dried apples.  This yummy bread makes great holiday gifts for friends and family!','bread',1,1.1999999999999999555,'t',NULL);
INSERT INTO items VALUES(4,'Sourdough Bread','It is a white bread characterized by a pronounced sourness because the dough is allowed to ferment.  Our style of sourdough is the San Francisco variety, one of the most popular in the world.  Sourdough is popular because of its ability to combine well with seafoods and soups, such as cioppino, clam chowder, and chili.','bread',1,1.1000000000000000888,'f',NULL);
INSERT INTO items VALUES(5,'Challah Bread','This is a Jewish egg bread that''s braided for a beautiful presentation. We top ours with poppy seeds for a special touch.','bread',1,0.9000000000000000222,'t',NULL);
INSERT INTO items VALUES(6,'Blueberry Muffins','A dozen of our most popular muffins. We use the same recipie our grandmother did to make her award-winning blueberry muffins.','muffins',12,1.0,'t',NULL);
INSERT INTO items VALUES(7,'Chocolate Zucchini Muffins','A tasty recipie our mom used to make to get us to eat our veggies as often as possible with the least complaining possible. Your kids will love them too!','muffins',12,1.1000000000000000888,'t',NULL);
INSERT INTO items VALUES(8,'Apple Carrot Muffins','Another recipie from mom to promote veggies in every meal.  These muffins contain fresh apple bits and shredded carrots.','muffins',12,1.1000000000000000888,'t',NULL);
INSERT INTO items VALUES(9,'Crossiants','A staple of French cuisine, our crossiants are light, fluffy and buttery.','pastries',4,1.0,'t',NULL);
INSERT INTO items VALUES(10,'Max''s Test Item','A really fun test item','bread',1,998.99999999999999997,'t',NULL);
